(1, 'Birthday Special', 'Surprise clients on their special day, a proven way to boost client loyalty and retention. This campaign automatically sends to clients close to their birthday.', 'Your special birthday gift!   ', 'Happy Birthday to You!', 'Celebrate your special day with a discount offer just for you!<br />\r\n<br />\r\nClick the button to book your next appointment with us and redeem your special online offer now.', 2, '10', '1', '30', 'Clients by birthday', 'This smart campaign automatically sends to clients once a year', 1, 1, 'BirthdayModel', 'public/uploads/schedule_library/birthday_default.png', 0, '<svg xmlns=\"http://www.w3.org/2000/svg\" viewBox=\"0 0 57 56\">\r\n													<g fill=\"none\" fill-rule=\"evenodd\">\r\n														<circle cx=\"28.5009918\" cy=\"28\" r=\"28\"\r\n															fill=\"#FFC830\">\r\n														</circle>\r\n														<g stroke=\"#FFF\" stroke-linecap=\"round\"\r\n															stroke-width=\"1.7\" transform=\"translate(15 15)\">\r\n															<path d=\"M24.0449946 13.5120015v10.3680013c0 1.1929352-.967065 2.1600002-2.1600002 2.1600002H5.46899241c-1.1929352 0-2.16000025-.967065-2.16000025-2.1600002V13.5120015\">\r\n															</path>\r\n															<rect width=\"25.9200031\" height=\"4.32000051\" x=\".71699185\" y=\"5.40000064\" rx=\"1.44000011\">\r\n															</rect>\r\n															<path d=\"M5.90099247 2.80800033c0-1.43152224 1.16047806-2.5920003 2.5920003-2.5920003 3.83400043 0 5.18400063 5.18400061 5.18400063 5.18400061H8.49299277c-1.43152224 0-2.5920003-1.16047806-2.5920003-2.59200031zM21.4529943 2.80800033c0-1.43152224-1.160478-2.5920003-2.5920003-2.5920003-3.8340004 0-5.1840006 5.18400061-5.1840006 5.18400061h5.1840006c1.4315223 0 2.5920003-1.16047806 2.5920003-2.59200031h0z\">\r\n															</path>\r\n														</g>\r\n													</g>\r\n												</svg>'),
(2, 'Welcome New Clients', 'Turn newcomers into regulars by encouraging first time clients to book again with a special discount. This campaign automatically sends to clients one day after their very first sale.', 'We would love to see you again soon ', 'First time\'s the charm!', 'We hope you enjoyed your first visit, we\'d love to see you again soon so we\'re offering a discount just for you!\r\n\r\nClick the button to book your next appointment with us and redeem your special online offer now.', 2, '10', '1', '30', 'New clients', 'This smart campaign automatically sends to new clients one day after their first ever sale', 0, 0, '', 'public/uploads/schedule_library/new_client_default.png', 0, '<svg xmlns=\"http://www.w3.org/2000/svg\" viewBox=\"0 0 57 56\">\r\n													<g fill=\"none\" fill-rule=\"evenodd\">\r\n														<circle cx=\"28.5009918\" cy=\"28\" r=\"28\"\r\n															fill=\"#60C290\"></circle>\r\n														<g stroke=\"#FFF\" stroke-linecap=\"round\"\r\n															stroke-width=\"1.7\">\r\n															<path d=\"M15.53398613 40.2167985l6.77999959-19.21679886L35.5139849 34.1999989l-19.21679882 6.7799996c-.21708985.0751084-.4580082.0196752-.6204417-.1427583s-.21786673-.4033519-.14275825-.6204417zM21.28558578 23.91419947L25.8509855 37.6103987M24.71398558 18.59999979l1.19999992-2.99999983M37.9139848 31.799999l2.9999998-1.1999999M35.5139849 28.1999996c.7956495 0 1.5587112-.3160709 2.1213203-.87868.5626091-.5626091.8786797-1.3256708.8786797-2.12132 0-1.65685436 1.3431455-3.00000003 3-3.00000003M28.3139854 21c0-1.65685451 1.3431456-3 3-3 1.6568539 0 3-1.34314585 3-3M31.9139851 24.59999943l3.5999998-3.59999979\">\r\n															</path>\r\n														</g>\r\n													</g>\r\n												</svg>'),
(3, 'Invite Clients to Book Online', 'Inspire clients to book their next appointment online with a special offer. This campaign automatically sends to clients who never booked online, one day after they make a sale.', 'Book with us online and save ', 'Your special online offer!', 'Thanks for dropping by recently, we\'d love to see you again soon so we\'re offering a discount just for you!<br/>\r\nClick the button to book your next appointment with us and redeem your special online offer now.', 2, '10', '1', '30', 'Online booking clients', 'This smart campaign automatically sends maximum once a month, to clients who never booked online, one day after they make a sale', 0, 0, '', 'public/uploads/schedule_library/devices_default_image.png', 0, '<svg xmlns=\"http://www.w3.org/2000/svg\" viewBox=\"0 0 56 56\">\r\n													<g fill=\"none\" fill-rule=\"evenodd\">\r\n														<circle cx=\"28\" cy=\"28\" r=\"28\" fill=\"#4EA1FF\">\r\n														</circle>\r\n														<g transform=\"translate(14 16)\">\r\n															<path stroke=\"#FFF\" stroke-linecap=\"round\"\r\n																stroke-width=\"1.7\"\r\n																d=\"M16.0089111 21.6999996H2.12499996C.95139489 21.6999996 0 20.7664657 0 19.6148933V4.18510631c0-1.15157244.95139489-2.08510635 2.12499996-2.08510635H21.6749996c1.1736051 0 2.125.93353391 2.125 2.08510635v4.96198842\">\r\n															</path>\r\n															<path stroke=\"#FFF\" stroke-linecap=\"round\"\r\n																stroke-width=\"1.7\"\r\n																d=\"M26.2499998 24.7100001h-5.8800001c-.6958788 0-1.26-.5641212-1.26-1.26V13.3699998c0-.6958788.5641212-1.26 1.26-1.26h5.8800001c.6958788 0 1.2600001.5641212 1.2600001 1.26v10.0800003c0 .6958788-.5641213 1.26-1.2600001 1.26z\">\r\n															</path>\r\n															<circle cx=\"23.3099998\" cy=\"22.7\" r=\"1\"\r\n																fill=\"#FFF\"></circle>\r\n															<path fill=\"#FFF\"\r\n																d=\"M20.9999996 12h4.9v1.3c0 .3865993-.3134007.7-.7.7h-3.5c-.386