(4, 'Win Back Clients', 'Target disengaged clients to return with a special offer, a proven tactic to lure clients back. This campaign sends to clients who did not return after a certain period of time.', 'We would love to see you again soon ', 'Something special just for you!', 'We\'d love to see you drop by again soon, so we\'re offering a special discount just for you!<br/>\r\nClick the button to book your next appointment with us and redeem your special offer now.', 2, '10', '1', '30', 'Lapsed clients', 'Clients with at least 3 sales anytime in the last 6 months, but did not return in the last 2 months', 1, 2, 'LapsedClientM', 'public/uploads/schedule_library/campaign_default.png', 0, '<svg xmlns=\"http://www.w3.org/2000/svg\" viewBox=\"0 0 57 56\">\r\n													<g fill=\"none\" fill-rule=\"evenodd\">\r\n														<circle cx=\"28.5009918\" cy=\"28\" r=\"28\"\r\n															fill=\"#E45A74\"></circle>\r\n														<g stroke=\"#FFF\" stroke-linecap=\"round\"\r\n															stroke-width=\"1.7\">\r\n															<path\r\n																d=\"M26.220991 30.2999987c-3.04991975 0-5.75531952.6890399-7.53299937 1.2884399-1.31219988.4438799-2.1869998 1.6804798-2.1869998 3.0661197v4.2854396H26.220991M26.220991 27.9599989h0c-2.98187976 0-5.39999955-3.49811971-5.39999955-6.47999946v-1.0799999C20.82099145 17.41811979 23.23911124 15 26.220991 15h0c2.9818797 0 5.3999995 2.41811979 5.3999995 5.39999954v1.0799999c0 2.98187975-2.4181198 6.47999946-5.3999995 6.47999946z\">\r\n															</path>\r\n														</g>\r\n														<path stroke=\"#FFF\" stroke-linecap=\"round\"\r\n															stroke-width=\"1.7\"\r\n															d=\"M30.8460914 33.6749995c.5994-2.3287499 2.7135-4.0499999 5.2298999-4.0499999 1.9979999 0 3.7421999 1.0854 4.6763999 2.6986499\">\r\n														</path>\r\n														<path fill=\"#FFF\" fill-rule=\"nonzero\"\r\n															d=\"M41.7518412 30.2880746l-.3279694 3.5999999-3.2720306-.7769248z\">\r\n														</path>\r\n