(5, 'Reward Regulars', 'Surprise top spenders with a special offer, a certain way to get your best clients even more engaged. This campaign automatically sends to clients based on recent sales activity.', 'You\'re our favorite ', 'Something special just for you!', 'You\'re one of our favorite clients, so we\'re offering a special discount just for you!<br/>\r\nClick the button to book your next appointment with us and redeem your special offer now.', 1, '10', '1', '30', 'Loyal clients', 'Clients with 3 or more sales, within the last 2 month period.', 1, 3, 'LoyalClientM', 'public/uploads/schedule_library/new_client_default.png', 0, '<svg xmlns=\"http://www.w3.org/2000/svg\" viewBox=\"0 0 57 56\">\r\n													<g fill=\"none\" fill-rule=\"evenodd\">\r\n														<circle cx=\"28.5009918\" cy=\"28\" r=\"28\"\r\n															fill=\"#9630EB\"></circle>\r\n														<path stroke=\"#FFF\" stroke-linecap=\"round\"\r\n															stroke-width=\"1.7\"\r\n															d=\"M29 34.5l-7.6412083 4.0172209 1.4593409-8.5086104-6.1818673-6.0258314 8.5431306-1.2413896L29 15l3.8206041 7.7413895 8.5431306 1.2413896-6.1818673 6.0258314 1.4593409 8.5086104z\">\r\n														</path>\r\n													</g>\r\n												</svg>');
