(73, 55, '161,162,167', 'Organic Shampoo, Condition + Cut', 'Organic Shampoo, Condition + Cut', 2, 'Having a clear understanding of your requirements prior the treatment is very important so we have allocated enough time for a thorough consultation regarding your hair, style and, at your request, the scalp. Collectively our barbers have 42 years experience in barbering and hairdressing so we feel we are well placed to understand and execute your desired look and feel. OWAY Frequently Use Hair and Scalp Bath and Conditioner (with lemon, white tea and Anisata) are used to cleanse and condition the hair and scalp. After the cut and before styling, clients enjoy a cooling hot towel to relax facial muscles and help remove any cut hair from the face, beard and neck. OWAY offers a variety of styling products - please indicate your preference or ask your barber to recommend a suitable option. Suitable for frequent haircuts i.e. once every 4 to 6 weeks. Please consider our Post-Lockdown Shampoo, Condition + Cut option if you have not had a haircut in the last three months or longer.', 0, 1, '34', 0, 0, 0, 5, 0, 1, 14, 'days', '2021-05-03 14:26:01', '2021-06-19 23:10:27', 0, NULL, NULL),
