(82, 55, '161', 'Organic Shampoo,Condition + Cut', 'Organic Shampoo, Condition + Cut', 32, 'Having a clear understanding of your requirements prior the treatment is very important so we have allocated enough time for a thorough consultation regarding your hair, style and, at your request, the scalp. Collectively our barbers have 42 years experience in barbering and hairdressing so we feel we are well placed to understand and execute your desired look and feel. OWAY Frequently Use Hair and Scalp Bath and Conditioner (with lemon, white tea and Anisata) are used to cleanse and condition the hair and scalp. After the cut and before styling, clients enjoy a cooling hot towel to relax facial muscles and help remove any cut hair from the face, beard and neck. OWAY offers a variety of styling products - please indicate your preference or ask your barber to recommend a suitable option. Suitable for frequent haircuts i.e. once every 4 to 6 weeks. Please consider our Post-Lockdown Shampoo, Condition + Cut option if you have not had a haircut in the last three months or longer.', 0, 1, '34', 0, 0, 0, 5, 0, 1, 14, 'days', '2021-05-08 10:08:43', '2021-06-19 23:10:27', 0, NULL, NULL),
(83, 55, '161,162,167', 'Post-lockdown Shampoo, Conditioning + Cut', 'Post-lockdown Shampoo, Conditioning + Cut', 32, 'Need to address \'lockdown\' hair (last cut 3 months or longer ago), re-shaping to your beloved Pre-COVID style or perhaps exploring a new look? We would be delighted to help but please help us deliver the quality we want in the time available to us. These cuts take a little longer than our standard Organic Shampoo, Conditioning and Cut. Sometimes our hair does not do what we have in mind for it so there might be options to explore with your barber and important outcomes to discuss. Consultation is key here. As for the rest, we won\'t skimp on any of it: OWAY products are used to cleanse and condition your scalp before your cut...with refreshments on tap whilst you watch the new shape develop or the return of your previous look. After that, well apply a hot towel to your face, completely relaxing your facial muscles in the moments before we complete your new style.', 0, 1, '34', 0, 0, 0, 5, 0, 1, 14, 'days', '2021-05-08 10:09:40', '2021-06-19 23:10:27', 0, NULL, NULL),
(84, 55, '161', 'Post-lockdown Shampoo,Conditioning + Cut', 'Post-lockdown Shampoo, Conditioning + Cut', 37, 'Need to address \'lockdown\' hair (last cut 3 months or longer ago), re-shaping to your beloved Pre-COVID style or perhaps exploring a new look? We would be delighted to help but please help us deliver the quality we want in the time available to us. These cuts take a little longer than our standard Organic Shampoo, Conditioning and Cut. Sometimes our hair does not do what we have in mind for it so there might be options to explore with your barber and important outcomes to discuss. Consultation is key here. As for the rest, we won\'t skimp on any of it: OWAY products are used to cleanse and condition your scalp before your cut...with refreshments on tap whilst you watch the new shape develop or the return of your previous look. After that, well apply a hot towel to your face, completely relaxing your facial muscles in the moments before we complete your new style.', 0, 1, '34', 0, 0, 0, 5, 0, 1, 14, 'days', '2021-05-08 10:11:38', '2021-06-19 23:10:27', 0, NULL, NULL),
